-->\n\nNgbAuthFirebaseUIModule->AuthProvidersComponent \n\n\n\n\n\nEmailConfirmationComponent \n\nEmailConfirmationComponent \n\nEmailConfirmationComponent  -->\n\nNgbAuthFirebaseUIModule->EmailConfirmationComponent \n\n\n\n\n\nNgbAlertsContainerComponent \n\nNgbAlertsContainerComponent \n\nNgbAlertsContainerComponent  -->\n\nNgbAuthFirebaseUIModule->NgbAlertsContainerComponent \n\n\n\n\n\nProgressBarComponent \n\nProgressBarComponent \n\nProgressBarComponent  -->\n\nNgbAuthFirebaseUIModule->ProgressBarComponent \n\n\n\n\n\n\n    \n    \n    \n        Zoom in\n        Reset\n        Zoom out\n    \n\n  \n\n    \n        \n            \n                \n                    \n                    \n                        1 Module\n                    \n                \n            \n        \n        \n            \n                \n                    \n                    5 Components\n                \n            \n        \n        \n            \n                \n                    \n                    3 Injectables\n                \n            \n        \n        \n            \n                \n                    \n                    4 Interfaces\n                \n            \n        \n    \n\n\n \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"miscellaneous/variables.html":{"url":"miscellaneous/variables.html","title":"miscellaneous-variables - variables","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n  Miscellaneous\n  Variables\n\n\n\n    Index\n    \n        \n            \n                \n                    \n                        \n                            collections(src/.../firestore-sync.service.ts)\n                        \n                        \n                            defaultAuthFirebaseUIConfig(src/.../config.interface.ts)\n                        \n                        \n                    